    def test_date_too_early(self):
        time = (7, 53)
        start_date = "30/6/2008"
        start_time = "23:59"
        charger_configuration = "6"
        location = "7bc703c4-f19b-4e51-981e-7cf4e5762efb"

        requests_mock = Mock()
        response_mock = Mock()
        requests_mock.get.return_value = response_mock
